import {createStore} from 'redux';



const reducerFN = (state, action) => {
    switch (action.type) {
        case 'PLACEHOLDER':
            return state;
        case 'ADD_IMAGE':
            return {
                ...state,
                Image: action.payload.Image,
            }
        default:
            return{
                Image: 'https://wallpaperaccess.com/full/317501.jpg',
            }
        case 'ADD_PHONE':
            return {
                ...state,
                Phone: action.payload.Phone,
                Phonevalid: action.payload.Phonevalid,
            }
        case 'ADD_CONTACT':
            return {
                ...state,
                Image: action.payload.Imagefinal,
                Phone: action.payload.Phonefinal,
                Phonevalid: action.payload.Phonevalidfinal,
                Name: action.payload.Namefinal,
                Email: action.payload.Emailfinal,
            }
            

        
    }
};  

const store = createStore(reducerFN);



export default store;
